package db.domain;// 例子: 10001:qw100:1000  给qw100充值 1000块钱public class OrderData implements Domain {	@Key	private int orderId;	private String orderData;	public OrderData() {	}	public OrderData(OrderData c) {		this.orderId = c.orderId;		this.orderData = c.orderData;	}	@Override	public String tableName() {		return "order_data";	}	public void setOrderId(int orderId) {		this.orderId = orderId;	}	public int getOrderId() {		return this.orderId;	}public void addOrderId(int orderId) {		this.orderId += orderId;}	public void setOrderData(String orderData) {		this.orderData = orderData;	}	public String getOrderData() {		return this.orderData;	}public void addOrderData(String orderData) {		this.orderData += orderData;}}